function Player({ fname, lname, age, position }) {
    return(
        <div>
            <p>{fname}</p>
            <p>{lname}</p>
            <p>{age}</p>
            <p>{position}</p>
            <h1>HIII</h1>
        </div>
    )
}

export default Player;
